  \"2015-09-27T02:54:30.904070\",\n\t\"name\": \"nitrate-nitrite-content-concentration-dissolved-oxygen-silicate-water-temperature-and-other-pro\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113339 includes profile,
  discrete sample, biological, chemical and physical data collected aboard the NEW
  HORIZON and WECOMA during cruises NH0207 and W0205A in the North Pacific Ocean from
  2002-05-29 to 2002-08-19. These data include NITRATE + NITRITE CONTENT (CONCENTRATION),
  DISSOLVED OXYGEN, SILICATE, WATER TEMPERATURE, AMMONIUM, FLUORESCENCE, PHOTOSYNTHETIC
  ACTIVE RADIATION (PAR), NITRATE, TRANSMISSIVITY, CHLOROPHYLL A, SALINITY, PHOSPHATE,
  NITRITE and PHAEOPIGMENTS. The instruments used to collect these data include bottle
  and CTD. These data were collected by Hal Batchelder of Oregon State University
  as part of NEP. The Biological and Chemical Oceanography Data Management Office
  (BCO-DMO) submitted these data to NODC on 2013-09-25.nnThe following is the text
  of the abstract provided by BCO-DMO:nnCTD Rosette Bottle Data from 2002 GLOBEC NEP
  cruises:nNew Horizon Cruise (NH0207: 1-19 August 2002)nWecoma Cruise (W0205: 29
  May - 18 June 2002)nNotes:nPhysical data processed by Jane Fleischbein (OSU).nChlorophyll
  readings done by Leah Feinberg (OSU).nNutrient analysis done by Burke Hales (OSU).nSummary
  prepared (22 July 2003) by: Hal Batchelder, Oregon State University, Corvallis,
  OR 97331-503. hbatchelder@coas.oregonstate.edu (mailto:hbatchelder@coas.oregonstate.edu)nnMetadata
